  \"2013-03-15T11:59:55.317602\",\n\t\"name\": \"spatial-vegetation-data-for-isle-royale-national-park-vegetation-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The National Park Service (NPS), in conjunction
  with the Biological Resources Division (BRD) of the U.S. Geological Survey (USGS),
  has implemented a program to \"develop a uniform hierarchical vegetation methodology\"
  at a national level. The program will also create a geographic information system
  (GIS) database for the parks under its management. The purpose of the data is to
  document the state of vegetation within the NPS service area during the 1990's,
  thereby providing a baseline study for further analysis at the Regional or Service-wide
  level. The vegetation units of this map were determined through stereoscopic interpretation
  of aerial photographs supported by field sampling and ecological analysis. The vegetation
  boundaries were identified on the photographs by means of the photographic signatures
  and collateral information on slope, hydrology, geography, and vegetation in accordance
  with the Standardized National Vegetation Classification System (October 1995).
  The mapped vegetation reflects conditions that existed during the specific year
  and season that the aerial photographs were taken (spring - 1996 and fall - 1994).
  There is an inherent margin of error in the use of aerial photography for vegetation
  delineation and classification.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
